import React, { Component } from 'react';
import { ReactComponent as Logo } from '../../assets/logo/logo.svg';
import '../../assets/logo/logo.css'


class Header extends Component {
    render () {
        return (
            <div>
                <Logo className="logo"/>
                <nav>
                <div>Shop</div>
                <div>Gift Card</div>
                <div>Our Fit</div>
                <div>Ask Us</div>
                <div>Card (0) ITEms</div>
                </nav>

            </div>
        )
    }
}


export default Header;
